import React from 'react';
import AppRouter from './routing/AppRouter';
import { BrowserRouter } from 'react-router-dom';

import { BrowserRouter as Router, Route, Switch, withRouter } from "react-router-dom";
import Hypertension from './hypertension/Hypertension';
import KidneyDisease from './kidneyDisease/KidneyDisease';
import MenuContainer from "./routing/menu";

const App: React.FC = () => {
  return (
    <BrowserRouter>
      {/* <AppRouter></AppRouter> */}
      <Route path="/" exact component={MenuContainer} />
            <Route path="/home" exact component={MenuContainer} />
            <Route path="/hypertension/" component={Hypertension} />
            <Route path="/kidneydisease/" component={KidneyDisease} />
    </BrowserRouter>
  );
}

export default App;
